function App() {
  const [state,setstate]=useState(1)
  function increment(){
    setstate(state+1)
    console.log(state)
  }
  return (
    <div className="App">
      <h1>Hi Ganesh</h1>
      <span style={{color:"red",alignItems:"center",justifyContent}}>
        <h3>{state}</h3>
      </span>
      <button onClick={increment}>increment</button>
    </div>
  );
}

export default App;
